import React, { Component } from 'react'

export default class targetTable extends Component {
  render() {
    return (
      <div>
        <table>
           	  <tr>
           	  	<th>Animals</th>
           	  	<th>Fruits</th>
           	  	<th>Numbers</th>
           	  	<th>Colours</th>
           	  </tr>
           	</table>
      </div>
    )
  }
}
